description: >-
  3rd Bachata Festival Hamburg


  Besuche dein Lieblingsfestival in Hamburg, direkt am Hafen. Eine familiäre Atmosphäre, tolle Tänzer und herausragende Künstler. Erweitere deine Kenntnisse und teile deine Leidenschaft mit einer wundervollen Community. Um ein qualitativ hochwertiges Event zu ermöglichen, sind die Tickets limitiert.


  3rd Bachata Festival Hamburg


  Join your favourite Bachata festival in town, right at the harbour of Hamburg. A familiar atmosphere, great dancers and amazing artists. Improve your skills and share your passion with an incredible community. In order to offer a high quality event, the tickets are limited.
